import Layout from "@/layout";
import { Box } from "@chakra-ui/react";
import Head from "next/head";

export default function Profile() {
  return (
    <Layout>
      <Head>
        <title>Profile</title>
      </Head>

      <Box bg="tomato" h="100px" w="100%"></Box>
    </Layout>
  );
}
